import { ThemingParameters } from '@ui5/webcomponents-react-base';
const styles = {
    content: {
        flex: '1 1 auto',
        overflow: 'hidden',
        position: 'relative',
        display: 'flex',
        borderRadius: `0 0 ${ThemingParameters.sapTile_BorderCornerRadius} ${ThemingParameters.sapTile_BorderCornerRadius}`
    }
};
export default styles;
